import React from 'react';
import { Link } from 'react-router-dom';
import styles from "./Project.module.css"

function Project() {

  return (
    <div id="projects" className={styles.project}> 
      <Link to="ecommerce" target='_blank' rel="noopener noreferrer">Ecommerce Website</Link>
      <Link to="ecommerce" target='_blank' rel="noopener noreferrer">Twice Fans Page</Link>
      <Link to="ecommerce" target='_blank' rel="noopener noreferrer">Bookkeeping Website</Link>
    </div>
  );
}

export default Project;
